(1, 'Jewelry', '<p>Lorem ipsum dolor sit amet, consectetur adipiscing elit. Nunc suscipit, tortor quis aliquam luctus, eros lorem ornare lectus, vitae tincidunt est leo ac lectus.</p>', '', '', '', 'jewelry'),
(2, 'Dance Tights', '<p>Vivamus ante lorem, eleifend nec interdum non, ullamcorper et arcu. Class aptent taciti sociosqu ad litora torquent per conubia nostra, per inceptos himenaeos.</p>', '', '', '', 'dance-tights'),
